import React from 'react';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: "Frankenstein"
        },
        {
          name: "Zombie"
        },
        {
          name: "Zigbie"
        }
      ]
    }
  }



}

export default App;
